import React, {Component} from 'react'
import {Link, BrowserRouter as Router, Route} from 'react-router-dom'
import RegisterForm from '../forms/Register'
import {PageRouter} from '../PageRoutes'
class Navbar extends Component{
    state = {
        isLoggedIn: false,
    }
    onActive = () => {
        console.log(this.state.currentPath)
        return this.props.setActivePath("http://localhost:3000/register", this.props.currentPath);
    }
    render(){
        return(
            <Router>
                <div>
                    <hr/>
                        <h2 style={navTextStyling}>News Products Login 
                                <Link style={this.onActive()} onClick={this.props.handleClick} to="/register">
                                    Register
                                </Link>
                        </h2>
                       
                    <hr/>   
                </div>   
                <Route path="/:id" component={PageRouter}/>
            </Router>     
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}

export default Navbar;
